import React from 'react';
import ResponsiveLayout, { MobileContainer, Button } from '../../components/ResponsiveLayout';

const GetStarted = () => {
  const handleGetStarted = () => {
    window.history.pushState({}, '', '/phone-number');
    window.location.reload();
  };

  return (
    <ResponsiveLayout fullHeight padding="none" backgroundType="solid">
      <div className="full-width-mobile flex items-end justify-center bg-gray-900 text-white">
        <MobileContainer maxWidth="full" className="w-full px-4 py-12">
          <div className="text-center space-y-8 pb-8">
            <h1 className="text-responsive-2xl font-bold font-serif">
              Invest in What's Next.
            </h1>

            <div className="flex justify-center">
              <Button
                onClick={handleGetStarted}
                variant="primary"
                size="lg"
                className="w-full max-w-sm"
              >
                Get started
              </Button>
            </div>
          </div>
        </MobileContainer>
      </div>
    </ResponsiveLayout>
  );
};

export default GetStarted;
